import './contactPage.styles.css'
const ContactPage = () => {
    return (
        <div className="container">
            <form >

            <label htmlFor="fname">First Name</label>
            <input type="text" id="fname" name="firstname" placeholder="Your name.." />


        </form>
    </div>
    )
}

export default ContactPage
